    false,nt"url": null,nt"notes": "This narrative report for Trempealeau NWR
    outlines Refuge accomplishments from May through August of 1942. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, and furbearers-
    is also covered. The Refuge development and maintenance section discusses plantings.
    Resource management is outlined; topics include haying. The public relations section
    of the report describes Refuge visitors. Photographs are attached.",nt"license_title":
